  `id` int(11) NOT NULL AUTO_INCREMENT,
  `grreport` int(11) DEFAULT NULL,
  `groups` longtext DEFAULT NULL,
  `obelisks` longtext DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
